export const PokemonCard = ({ pokemonCustom }) => {
  return (
    <div>
      <img
        src={pokemonCustom.data.sprites.other["official-artwork"].front_default}
        width="300px"
        alt="pokemon"
      />
      <h2>{pokemonCustom.data.name}</h2>
      <p>Weight: {pokemonCustom.data.weight}</p>
    </div>
  );
};
